export default class Header extends React.Component{
    render(){
        return(
            <div style={{width: "100%", height: "7%", background: "#27E1F2", flex:1, justifyContent: 'center'}}>
                <text style={{fontFamily: 'Helvetica', fontSize: 20}}>
                    Max Johnson
                </text>
            </div>
        )
    }
}
